export const listBooks = (books, language) => ({
    type: 'LIST_ALL_BOOKS',
    payload: {
        books: books,
        language: language
    }
})


export const addBook = (book) => ({
    type: 'ADD_BOOK',
    payload: {
        book: book
    }
})
